                height: 39.5rem;
                margin-top: 2.2rem;
                margin-bottom: -13.1rem;
            }
        }
    }
    &__main {
        grid-column: 3/15;
        grid-template-columns: repeat(12, 1fr);
        position: relative;
        z-index: 1;
        padding-bottom: 11rem;
        &-img-wrap {
            grid-column: 5/9;
            grid-row: 1/2;
            pointer-events: none
        }
        &-inner {
            grid-column: 1/13;
            grid-row: 1/2;
            grid-template-columns: repeat(12, 1fr);
        }
        &-item {
            display: flex;
            flex-direction: column;
            max-width: 28.6rem;
            &-title {
                margin-bottom: 2rem;
            }
            &-txt {
                color: rgba($cl-body, 1);
            }
            &:nth-child(odd) {
                justify-self: end;
                align-items: end;
                text-align: right;
            }
            &:nth-child(1) {
                grid-column: 1/4;
                margin-top: 25.7rem;
            }
            &:nth-child(2) {
                grid-column: 10/13;
                margin-top: 25.7rem;
            }
            &:nth-child(3) {
                grid-column: 1/4;
                grid-row: 2/3;
                margin-top: 9.5rem;
            }
            &:nth-child(4) {
                margin-top: 9.5rem;
                grid-column: 10/13;
                grid-row: 2/3;
            }
        }
        &-btn {
            margin-top: 10.4rem;
            grid-column: 5/9;
            justify-self: center;
        }
    }
    &__tail {
        &-title {
            padding-top: 11rem;
            grid-column: 2/11;
            max-width: 81.4rem;
            margin-bottom: 12.8rem;
        }
        &-img {
            grid-column: 1/17;
            padding-bottom: 12.4rem;
        }
    }
    &__bg-img {
        height: clamp(72rem, 72vh, 92rem);
        img {
            display: block;
        }
    }
}
